import logo from './logo.svg';
import './App.css';
import { YoutubeData } from './data.js';
import YoutubeItem from './Components/youtube/YoutubeItem';
imp


function App() {
  return (
    <div className='youtube-list'>
      {
        YoutubeData.map((item, index) => (
          <YoutubeItem
            key = {item.id}
            imgHeader = {item.imgHeader}
            imgAvatar = {item.imgAvatar}
            title = {item.title}
            time = {item.time || "anonymous"}
            className= {index===1 ? "abc" : ""}
          ></YoutubeItem>
        ))
      }
    </div>
  );
